  const [value, setValue] = useState<[number, number]>([1000000, 10000000]);
  const [output, setOutput] = useState(value);
  const [errorMax, setErrorMax] = useState(false);
  const [errorMin, setErrorMin] = useState(false);
  const onBlurMax = () => {
    if (value[1] < value[0]) {
      setErrorMax(true);
    } else {
      setErrorMax(false);
    }
  };
  const onBlurMin = () => {
    if (value[0] > value[1]) {
      setErrorMin(true);
    } else {
      setErrorMin(false);
    }
  };
  return <>
      <output>
        {output[0]} - {output[1]} kr
      </output>
      <div style={{
      width: '320px',
      outline: '1px dashed red'
    }}>
        <RangeSlider onChange={setValue} onInput={setOutput} min={1000000} max={10000000} step={50000} value={value} />
        <div className="w-slider__input">
          <TextField label="Min" value={value[0].toString()} type="number" invalid={errorMin} helpText={errorMin ? 'Min cannot be greater than max' : ''} onBlur={onBlurMin} onChange={e => setValue([+e.target.value, value[1]])} />
          <TextField label="Max" value={value[1].toString()} type="number" invalid={errorMax} helpText={errorMax ? 'Max cannot be lower than min' : ''} onBlur={onBlurMax} onChange={e => setValue([value[0], +e.target.value])} />
        </div>
      </div>
    </>;
